import React from "react";
import ProgressBar from "react-bootstrap/ProgressBar";

const skill = [
  {type: "HTML", level: 99},
  {type: "CSS", level: 98},
  {type: "JavaScript", level: 87},
  {type: "jQuery", level: 92},
  {type: "BootStrap", level: 90},
  {type: "Photoshop", level: 100},
  {type: "Angular.js", level: 16},
  {type: "React.js", level: 25},
  {type: "PHP", level: 36},
  {type: "Ruby", level: 11}
];


function SkillsBar({ skill, value, isScrolled }) {
  return (
    <div style={{ width: "95%" }}>
      <p className="lead mb-1 mt-2">{skill}</p>
      <ProgressBar
        className={!isScrolled ? "progress" : " progress-bar-animation"}
        now={value}
      />
    </div>
  );
}

export default SkillsBar;
